// src/index.js
import React from 'react';
import { createRoot } from 'react-dom/client';
import App from './App';

// Performance monitoring
import { performanceMonitor } from './utils/performanceMonitor';
import reportWebVitals from './reportWebVitals';

// Global styles
import './styles/globals.css';
import './styles/animations.css';
import './styles/components.css';
import './styles/components.css';

// Initialize performance monitoring
performanceMonitor.recordMetric('app_initialization', {
  timestamp: Date.now(),
  userAgent: navigator.userAgent,
  viewport: {
    width: window.innerWidth,
    height: window.innerHeight
  },
  connection: navigator.connection ? {
    effectiveType: navigator.connection.effectiveType,
    downlink: navigator.connection.downlink,
    rtt: navigator.connection.rtt
  } : null
});

// Get the root element
const container = document.getElementById('root');

// Check if root element exists
if (!container) {
  throw new Error('Root element not found. Make sure you have a div with id="root" in your HTML.');
}

// Create root and render app
const root = createRoot(container);

// Development mode checks
if (process.env.NODE_ENV === 'development') {
  // Enable React DevTools profiler
  if (typeof window !== 'undefined') {
    window.__REACT_DEVTOOLS_GLOBAL_HOOK__?.onCommitFiberRoot;
  }

  // Log environment variables for debugging
  console.log('ðŸš€ Development Mode Enabled');
  console.log('Environment Variables:', {
    API_URL: process.env.REACT_APP_API_URL,
    HARDWARE_BRIDGE_URL: process.env.REACT_APP_HARDWARE_BRIDGE_URL,
    ENABLE_HARDWARE: process.env.REACT_APP_ENABLE_HARDWARE,
    VERSION: process.env.REACT_APP_VERSION
  });
}

// Render the application
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

// Performance monitoring and web vitals
const sendToAnalytics = (metric) => {
  // Log to console in development
  if (process.env.NODE_ENV === 'development') {
    console.log('ðŸ“Š Web Vital:', metric);
  }

  // Send to performance monitoring service
  performanceMonitor.recordMetric('web_vital', {
    name: metric.name,
    value: metric.value,
    rating: metric.rating,
    delta: metric.delta,
    timestamp: Date.now()
  });

  // Send to analytics service in production
  if (process.env.NODE_ENV === 'production' && process.env.REACT_APP_ANALYTICS_ID) {
    try {
      // Example: Send to Google Analytics 4
      if (window.gtag) {
        window.gtag('event', metric.name, {
          event_category: 'Web Vitals',
          event_label: metric.id,
          value: Math.round(metric.name === 'CLS' ? metric.value * 1000 : metric.value),
          non_interaction: true
        });
      }

      // Example: Send to custom analytics endpoint
      fetch('/api/v1/analytics/web-vitals', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({
          metric,
          timestamp: Date.now(),
          userAgent: navigator.userAgent,
          url: window.location.href
        })
      }).catch(error => {
        console.warn('Failed to send web vitals to analytics:', error);
      });
    } catch (error) {
      console.warn('Analytics error:', error);
    }
  }
};

// Start web vitals monitoring
reportWebVitals(sendToAnalytics);

// Global error handlers for unhandled promises and errors
window.addEventListener('unhandledrejection', (event) => {
  console.error('Unhandled promise rejection:', event.reason);

  performanceMonitor.recordMetric('unhandled_rejection', {
    reason: event.reason?.toString() || 'Unknown',
    stack: event.reason?.stack || 'No stack trace',
    timestamp: Date.now()
  });

  // Don't prevent default to allow normal error handling
});

window.addEventListener('error', (event) => {
  console.error('Global error:', event.error);

  performanceMonitor.recordMetric('global_error', {
    message: event.message,
    filename: event.filename,
    lineno: event.lineno,
    colno: event.colno,
    stack: event.error?.stack || 'No stack trace',
    timestamp: Date.now()
  });
});

// Monitor page visibility for analytics
document.addEventListener('visibilitychange', () => {
  performanceMonitor.recordMetric('visibility_change', {
    hidden: document.hidden,
    timestamp: Date.now()
  });
});

// Monitor online/offline status
window.addEventListener('online', () => {
  performanceMonitor.recordMetric('connection_change', {
    online: true,
    timestamp: Date.now()
  });

  console.log('ðŸŒ Connection restored');
});

window.addEventListener('offline', () => {
  performanceMonitor.recordMetric('connection_change', {
    online: false,
    timestamp: Date.now()
  });

  console.log('ðŸŒ Connection lost');
});

// Development hot module replacement
if (process.env.NODE_ENV === 'development' && module.hot) {
  module.hot.accept('./App', () => {
    const NextApp = require('./App').default;
    root.render(
      <React.StrictMode>
        <NextApp />
      </React.StrictMode>
    );
  });
}

// Log successful application start
console.log(`ðŸ¤– Robotics Challenge App started successfully`);
console.log(`ðŸ“Š Performance monitoring enabled`);
console.log(`ðŸ”§ Environment: ${process.env.NODE_ENV}`);

if (process.env.REACT_APP_VERSION) {
  console.log(`ðŸ“¦ Version: ${process.env.REACT_APP_VERSION}`);
}

// Initialize app-specific performance tracking
performanceMonitor.recordMetric('app_ready', {
  timestamp: Date.now(),
  loadTime: performance.now(),
  memoryUsage: performance.memory ? {
    used: performance.memory.usedJSHeapSize,
    total: performance.memory.totalJSHeapSize,
    limit: performance.memory.jsHeapSizeLimit
  } : null
});
